import Link from 'next/link'

const linkStyle = {
    textDecoration: 'none',
    width: '100%',
    fontSize: '25px',
    color: 'rgb(118, 165, 165',
    backgroundColor: 'white',
    padding: '15px'
  }

  const navStyle = {
    borderBottom: '1px solid white',
    paddingTop: '10px'
  }

const Header = () => (
    <div style={navStyle}>
        <Link href="/">
            <a style={linkStyle}>Home</a>
        </Link>
    </div>
)

export default Header;
